function NYA() {
  document.getElementById("logoimage").innerHTML =
    '<img class="teamlogo" itemscope="image" alt="New York Yankees Logo" src="http://content.sportslogos.net/logos/53/68/full/1256.png">';
  document.getElementById("tt0").innerText = "New York Yankees";
  document.getElementById("tt1").innerHTML =
    "<strong>Team Names: </strong>New York Yankees, New York Highlanders";
  document.getElementById("tt2").innerHTML =
    "<strong>Seasons: </strong>\117 (1903 to 2019) ";
  document.getElementById("tt3").innerHTML =
    "<strong>Record: </strong>\10378-7840, .570 W-L% ";
  document.getElementById("tt4").innerHTML =
    "<strong>Playoff Appearances: </strong>\55";
  document.getElementById("tt5").innerHTML = "<strong>Pennants: </strong>\40";
  document.getElementById("tt6").innerHTML =
    "<strong>World Championships: </strong>\27";
  document.getElementById("tt7").innerHTML =
    "<strong>Winningest Manager: </strong>Joe McCarthy, 1460-867, .627 W-L%";

  globalTeam = "NYA";
  clearBox("charts");
  var html = "";
  for (var yr in NYAData) {
    html =
      html +
      '<div id="' +
      NYAData[yr].name +
      '" class="year" data-title="' +
      NYAData[yr].title +
      '" data-subtitle="' +
      NYAData[yr].subtitle +
      '"></div>';
  }

  $("#charts").append(html);

  $.getScript("https://code.highcharts.com/highcharts.js", function() {
    var chart;
    $(document).ready(function() {
      //Setting the global default
      Highcharts.setOptions({
        chart: {
          type: "areaspline",
          marginRight: 2,
          marginBottom: 5,
          threshold: null
        },
        colors: ["#173368"],
        title: {
          style: {
            color: "#000000",
            /*fontWeight: 'bold',*/
            fontSize: "13px"
          },
          align: "left",
          floating: true,
          x: 35,
          y: 15
        },
        subtitle: {
          align: "left",
          floating: true
        },
        xAxis: {
          categories: []
        },
        yAxis: {
          plotLines: [
            {
              value: 0,
              width: 1,
              color: "#cccccc"
            }
          ],
          title: {
            text: "",
            margin: 0
          },
          plotLines: [
            {
              value: 0,
              width: 1,
              color: "#cccccc"
            }
          ],
          min: -20,
          max: 40
        },
        tooltip: {
          borderWidth: 0,
          formatter: function() {
            return "<b>" + this.point.name + "</b><br/>" + this.point.result;
          }
        },
        plotOptions: {
          series: {
            step: true,
            marker: {
              enabled: false
            }
          }
        },
        legend: {
          enabled: false
        },
        credits: {
          enabled: false
        }
      }); // end setting global default for all charts

      // Render all the charts!
      for (var yr in NYAData) {
        var options = {
          chart: {
            renderTo: NYAData[yr].name
          },
          title: {
            text: NYAData[yr].year
          },
          subtitle: {
            text: ""
          },
          series: [
            {
              name: NYAData[yr].name,
              data: NYAData[yr].data
            }
          ]
        };

        if (NYAData[yr].won < 1) {
          //losing year
          options.series[0].color = "#aa0016";
        }

        var chart = new Highcharts.Chart(options);
      }
    });
  });
}

